import React from 'react';
import './App.css';

function App() {
  return (
    <div className="aboutMe">
      <div className="container">
        <div className="row">
          <div className="col-md-12">
            <div className="introText">
              Hi! My Name is
            </div>
          </div>
        </div>
        <div className="row">
          <div className="col-md-12">
            <div className="nameText">
              Saron Nhong.
            </div>
          </div>
        </div>

      </div>


    </div>
  );
}

export default App;
